// PastOrdersPage.js

import React from 'react';

const PastOrdersPage = ({ pastPurchases }) => {
  return (
    <div>
      <h2>Past Orders</h2>
      {pastPurchases.map((item) => (
        <div key={item.id} className="past-order-item-container">
          <p>Event Name: {item.event_name}</p>
          <p>Location: {item.location}</p>
          <p>Price: ${item.price}</p>
          <p>Tickets Amount: {item.tickets_amount}</p>
          {/* Add any additional information you want to display for past orders */}
        </div>
      ))}
    </div>
  );
};

export default PastOrdersPage;
